url = "data:image/png;base64,"
image = new Image();
size = 48
sizew = 48
image.src = url;

image.onload = function() {
    var style = ['font-size: 1px;', 'padding: ' + this.height / 100 * size + 'px ' + this.width / 100 * sizew + 'px;', 'background: url(' + url + ') repeat;', //'background-size: contain;'
    ].join(' ');
    console.log('%c ', style);
}

